import moment from 'moment';
import React from 'react';

const Test = () => {
  let now = moment();
  let date = new Date();
  return (
    <div className="form-container">
      <span>{`Moment: ${now}`}</span>
      <br/>
      <span>{`Date: ${date}`}</span>
    </div>
  )
}

export default Test;
